import { Route } from "react-router-dom";
import MainHeader from "./Components/MainHeader";

import Product from "./Pages/Product";
import Welcome from "./Pages/Welcome";

function App() {
  return (
    <div>
      <MainHeader />
      <Route path="/welcome">
        <Welcome />
      </Route>
      <Route path="/product">
        <Product />
      </Route>
    </div>
  );
}

export default App;
